  createTask() {
    alert("boop");
  }
  render() {
    return (
      <div className="inputContainer">
        <input type="text" value="add task"></input>
        <button className="addButton" onClick={this.createTask}></button>
        <button className="priorityButton"></button>
        <button className="priorityButton"></button>
        <button className="priorityButton"></button>
      </div>
    );
  }
}
